// --- FCKEditor Integration ----
var oEditor = window.opener;
var FCKEquation=null;
var eSelected=null;

// Loads the equations from the fckeditor, or create a default equations for an example
var WYSIWYG = {
	load : function()
	{
		// Look for fckeditor
		if(oEditor && typeof(oEditor.FCKEquation)!='undefined')
		{
			FCKEquation = oEditor.FCKEquation;
			if(FCKEquation) 
				eSelected = oEditor.FCKSelection.GetSelectedElement();
			else alert('Can not find FCK');
			if ( eSelected && eSelected.tagName == 'IMG' && eSelected._fckequation )	{
				var comm = unescape( eSelected._fckequation );
				var parts = comm.match( /(\\\[|\$)(.*?)(\\\]|\$)/ );
				
				$$('latex_formula').value = parts[2];
				$$('inline').checked=(parts[1]=='$');	
				textchanged();
				renderEqn(null);
				fadeout('intro');
			}
			else	{
				// Put any default equations in the line below...
				$$('latex_formula').value = '';
				eSelected = null ;
			}	
		}
	},

  update : function(text)
	{			
		if (text.length == 0) {
			alert(FCKLang.EquationErrNoEqn) ;
			return false;
		}	
			
		if ( eSelected && eSelected._fckequation == text )
			return true;
		
		FCKEquation.Add(text);
	}
};
AC_FL_RunContent = 0;

EqnExport=function(text) {
  EqEditor.addText(window.opener.document, mySetterField, text); 
	window.blur();
};


var a=new EqTextArea(); 
a.set();
a.load('');

EqEditor.init('1282723377020.6921',a,true);
ExportButton.add(a, 'copybutton', EqnExport, 'html');



